import styled from "styled-components";

const StyledList = ({ title }) => {
  return (
    <>
      <Title>{title}</Title>
    </>
  );
};

export default StyledList;

const Title = styled.div`
  color: Gold;
  font-size: 22px;
  margin: 2.5%;
  text-align: center;
`;
